summary:
Mue par l'envie d'entreprendre, j’ai à cœur de contribuer à transformer des marchés traditionnels à l’aide des outils et opportunités créés par le digital et les nouvelles technologies. Cette passion s'est exprimée dans des écosystèmes différents, de la start-up à la PME, en passant par un grand groupe international.

Mes sujets de prédilection sont :
- Aider les entreprises et leurs salariés à prendre le virage du numérique et à comprendre les opportunités créées par cette révolution inéluctable;
- Fédérer mes équipes autour d’un projet et d’une culture d’entreprise forte ;
- Coordonner les équipes commerciales, marketing et opérationnelles pour accélérer la croissance de l’activité globale;
- M'ouvrir à de nouveaux sujets en accompagnant des entrepreneurs dans leur développement, en tant qu'investisseur ou membre du board.
